import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import Card from "./Card";
import "tachyons";

const root = ReactDOM.render(
	<div className="bg-light-green dib br3 pa3 ma2 grow">
		<React.StrictMode>
			<Card />
			<Card />
			<Card />
		</React.StrictMode>
	</div>,
	document.getElementById("root")
);

